import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route} from "react-router-dom";
import Home from '../Components/home';
import Login from '../Components/login';
import Myaccount from '../Components/my_account';
import ProductDetail from '../Components/product/ProductDetail';
import ProductPage from '../Components/product/productPage';
// import axios from 'axios';
class App extends React.Component {
  constructor(props){  
    super(props);  
    this.state = {  
      isUserAthanticated: false,
      address: null,
      city: null,
      contact: null,
      date_of_birth: null,
      email: "jayesh.chouhan@cubexo.com",
      gender: "",
      id: 25,
      name: "jayehs",
      profile_picture: "/media/user_profile/default_image/default-user-photo-79.jpg"
    }
  }

  handleUpdate = (value) => {
    var address ,city, contact, date_of_birth, email,id,name,gender,profile_picture;
    this.setState({ 
      isUserAthanticated: true ,
      address: address,
      city: city,
      contact: contact,
      date_of_birth: date_of_birth,
      email: email,
      gender: gender,
      id: id,
      name: name,
      profile_picture: profile_picture
    })
  }


  render(){
    return (
      <Router>
        <Routes>
          <Route exact path="/" element={<Home updateState={this.handleUpdate} isUserAthanticated={this.state}/>} />
          <Route exact path="/shop" element={<Home updateState={this.handleUpdate} isUserAthanticated={this.state}/>} />
          <Route exact path="/products" element={<ProductPage updateState={this.handleUpdate} isUserAthanticated={this.state}/>}/>
          <Route exact path="/products/:productId" element={<ProductDetail updateState={this.handleUpdate} isUserAthanticated={this.state}/>}/>
          <Route exact path="/pages" element={<Home updateState={this.handleUpdate} isUserAthanticated={this.state}/>} />
          <Route exact path="/blog" element={<Home updateState={this.handleUpdate} isUserAthanticated={this.state}/>} />
          <Route exact path="/elements" element={<Home updateState={this.handleUpdate} isUserAthanticated={this.state}/>} />
          <Route path="/my_account" element={ <Myaccount updateState={this.handleUpdate} changeState={this.changestate} isUserAthanticated={this.state}/>} />
          <Route path="/login" element={ <Login  updateState={this.handleUpdate} changeState={this.changestate} isUserAthanticated={this.state}/>} />
          <Route path="/logout" element={ <Login  updateState={this.handleUpdate} changeState={this.changestate} isUserAthanticated={this.state}/>} />
          {/* <Navigate to="/" element={<Home />} /> */}
        </Routes>
      </Router>
    );
  }
}

export default App;
